Dick Cavett's Watergate

History Documentary with no narration published by PBS broadcasted as part of PBS Secrets of the Dead series in 2014 - English language


Information
------------------------------

From 1972 to 1974 the Watergate scandal unfolded on THE DICK CAVETT SHOW, as Cavett interviewed nearly every major Watergate figure. Even non-political guests expressed their opinions about Watergate on the show. With exclusive access to the archive of THE DICK CAVETT SHOW, &quot;Dick Cavett's Watergate&quot; documents the scandal in the words of the people who lived it: from the botched burglary at the Democratic National Headquarters; to the must-see TV of the daily Congressional Watergate hearings; to the on-going behind-the-scenes battle between the White House and THE DICK CAVETT SHOW; culminating with the resignation of the President of the United States on August 9, 1974. Dick Cavett's Watergate offers a unique opportunity to mark the 40th anniversary of a defining moment in American history.

